"\n"
"QMenu::item:selected {\n"
"        color: #AFBDC4;\n"
"}\n"
"\n"
"QMenu::item:pressed {\n"
"        color: #FFFFFF;\n"
"}\n"
"\n"
"QMenu::separator {\n"
"        height: 1px;\n"
