"}\n"
"\n"
"QMenuBar::item:selected {\n"
"        color: #AFBDC4;\n"
"}\n"
"\n"
"QMenuBar::item:pressed {\n"
"        color: #FFFFFF;\n"
"}\n"
"\n"
