"}\n"
"\n"
"QToolButton::menu-button:hover, QToolButton::menu-button:pressed {\n"
"        background-color: #263238;\n"
"}\n"
"\n"
"QStatusBar {\n"
"        background-color: #263238;\n"
"}\n"
"\n"
"QLabel {\n"
"        color: #546E7A;        /* Text at the bottom right corner of the screen */\n"
"}\n"
"\n"
